description:
22 More Hits is George Strait&amp;#039;s 2007 compilation CD, comprising 22 hits that didn&amp;#039;t reach #1 from his 1981 debut single &quot;Unwound&quot; to his most recent single at the time of the album&amp;#039;s release, &quot;How &amp;#039;Bout Them Cowgirls.&quot; The collection is intended as a companion to 50 Number Ones, a 2004 compilation which featured all of Strait&amp;#039;s singles that had reached #1 to that point.

The album was released by MCA Nashville Records on November 13 and debuted at number 13 on the U.S. Billboard 200 chart, selling about 80,000 copies in its first week.

